import React, { Component } from 'react';
import './App.css';

import Toolbar from './components/Toolbar/Toolbar'

const navStyle = {
  backgroundColor: '#220000',
  color: '#fff'
}

function App() {
  return (
    <div className="App">
      <Toolbar />
      <main style={{ marginTop: '64px'}}>
      <p>This is the page content</p>
      </main>
    </div>
  );
}

export default App;
